function findSmallest($input)
{
	$shortest = "";
	
	for ($i = 97; $i < 123; $i++)
	{
		$try = fuckUnit($i, $input);
		$try = doReaction($try);
		
		if (strlen($try) < strlen($shortest) || $shortest == "")
		{
			$shortest = $try;
		}
	}
	
	return $shortest;
}

function fuckUnit($unit, $input)
{
	$lower = chr($unit);
	$upper = chr($unit-32);
	
	$input = str_replace($lower, "", $input);
	$input = str_replace($upper, "", $input);
	
	return $input;
}

function doReaction($input)
{
	do
	{
		$startLength = strlen($input);
		
		for ($i = 97; $i < 123; $i++)
		{
			$checkFor1 = chr($i) . chr($i-32);
			$checkFor2 = chr($i-32) . chr($i);
			
			$input = str_replace($checkFor1, "", $input);
			$input = str_replace($checkFor2, "", $input);
		}
		
		$afterLength = strlen($input);
		
	} while ($afterLength < $startLength);
	
	return $input;
}

